contract SimpleCounter {
    int private count;

    function setCount(int newCount) public {
        count = newCount;
    }

    function getCount() public view returns (int) {
        return count;
    }

    function increment() public {
        count += 1;
    }

    function decrement() public {
        count -= 1;
    }
}

